import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { BrowserRouter } from 'react-router-dom';

ReactDOM.createRoot(
  <BrowserRouter>
    <App />
  </BrowserRouter>,
  document.getElementById('root')
);
